<script>
	import { ViewBox, XHeader, Swiper, Tabbar, TabbarItem, Grid, GridItem, Drawer, Loading,Toast,Badge,XButton,XDialog} from 'vux'
	import api from '../../components/other/api-url'
	import globalPM from '../../components/other/global-parameter'
	import axios from 'axios'
	import Cookies from 'js-cookie'
	import router from '../../router/index'
	export default {
		components: { ViewBox, XHeader, Swiper, Tabbar, TabbarItem, Grid, GridItem, Drawer, Loading,Toast,Badge ,XButton,XDialog},
		data() {
			return {
				errorStatus: false,
				errorMsg: '',
				loading: false,
				monery:'',
				commissionIncome:'',//提成
				shareIncome:'',//分润
				alreadyDeposit:'',//提现
				disabled:false,
				showdialog:false,
				monthIncome:'',
				balance:'',
				refereeCount:'',
				huiyuan:'',
			}
		},
		methods: {
			bill(){//账单
				router.push('/withdrawbill')
			},
			yaoqing(){
				$('.imgaaa').on('click',function  () {
					$('.-mob-share-ui').removeClass('nono')
        		    $(".mask").show('fade');
				})
			},
			maska(){
				$('.-mob-share-ui').addClass('nono')
        		$(".mask").hide('fade');
			},
			vip(){//开通会员
				router.push('/vip')
			},
			closea(){
				router.push("/face")
			},
			tixian(){
				const _this = this
				axios.post(api + '/user/real/state?' + '&uid=' + localStorage.getItem("uid") + '&token=' + localStorage.getItem("token") + '&valid=0' + globalPM).then(function (response) {
	              _this.loading = false
	              console.log(response.data)
	              if (response.data.data.state === 1) {
	                router.push('/withdraw')
	              }
	              if (response.data.data.state === 0) {
	                _this.showdialog = true;
	              }
	              if (response.data.code === 110) {
		            router.push('/login')
		          }
	          })
			},
			tichen(){
				router.push('/tichen')
			},
			fenrun(){
				router.push('/fenrun')
			},
			yitixian(){
				router.push('/yitixian')
			}
		},
		created() {
			let _this = this
			localStorage.setItem('yaoqinga',2)
			localStorage.setItem('invite',1)
			_this.monthIncome = localStorage.getItem('monthIncome')
			_this.refereeCount = localStorage.getItem('refereeCount')
			_this.balance = localStorage.getItem('balance')
			_this.commissionIncome = localStorage.getItem('commissionIncome')
			_this.shareIncome = localStorage.getItem('shareIncome')
			_this.alreadyDeposit = localStorage.getItem('alreadyDeposit')
			_this.huiyuan = localStorage.getItem('huiyuan')
			/*if(!navigator.onLine){
				_this.monthIncome = localStorage.getItem('monthIncome')
				_this.refereeCount = localStorage.getItem('refereeCount')
				_this.balance = localStorage.getItem('balance')
				_this.commissionIncome = localStorage.getItem('commissionIncome')
				_this.shareIncome = localStorage.getItem('shareIncome')
				_this.alreadyDeposit = localStorage.getItem('alreadyDeposit')
			}*/
			if (localStorage.getItem('wallet')==1) {
					location.reload()
					localStorage.setItem('wallet',2)
				}
			_this.balance = localStorage.getItem('balance')
			//获取我的钱包详情
			axios.post(api + '/user/wallet/info?' + '&uid=' + localStorage.getItem('uid') + '&token=' + localStorage.getItem('token') + '&valid=0' + globalPM).then(function (res) {
				console.log(res.data)
		        if (res.data.code === 0) {
		        	localStorage.setItem('balance',res.data.data.balance)
		        	if (res.data.data.balance == 0) {//余额（元）
		        		_this.balance = parseFloat(res.data.data.balance).toFixed(2)
		        		localStorage.setItem('balance',_this.balance)
		        	}else{
		        		_this.balance = parseFloat(res.data.data.balance).toFixed(2)
		        		localStorage.setItem('balance',_this.balance)
		        	}
		        	if (res.data.data.commissionIncome == 0) {//提成收益（元）
		        		_this.commissionIncome = parseFloat(res.data.data.commissionIncome).toFixed(2)
		        		localStorage.setItem('commissionIncome',_this.commissionIncome)
		        	}else{
		        		_this.commissionIncome = parseFloat(res.data.data.commissionIncome).toFixed(2)
		        		localStorage.setItem('commissionIncome',_this.commissionIncome)
		        	}
		        	if (res.data.data.shareIncome == 0) {//分润提成（元）
		        		_this.shareIncome = parseFloat(res.data.data.shareIncome).toFixed(2)
		        		localStorage.setItem('shareIncome',_this.shareIncome)
		        	}else{
		        		_this.shareIncome = parseFloat(res.data.data.shareIncome).toFixed(2)
		        		localStorage.setItem('shareIncome',_this.shareIncome)
		        	}
		        	if (res.data.data.alreadyDeposit == 0) {//已提现
		        		_this.alreadyDeposit = parseFloat(res.data.data.alreadyDeposit).toFixed(2)
		        		localStorage.setItem('alreadyDeposit',_this.alreadyDeposit)
		        	}else{
		        		_this.alreadyDeposit = parseFloat(res.data.data.alreadyDeposit).toFixed(2)
		        		localStorage.setItem('alreadyDeposit',_this.alreadyDeposit)
		        	}
		        	if (res.data.data.monthIncome == 0) {//当月收益（元）
		        		_this.monthIncome = parseFloat(res.data.data.monthIncome).toFixed(2)
		        		localStorage.setItem('monthIncome',_this.monthIncome)
		        	}else{
		        		_this.monthIncome = parseFloat(res.data.data.monthIncome).toFixed(2)
		        		localStorage.setItem('monthIncome',_this.monthIncome)
		        	}
		        	_this.refereeCount = res.data.data.refereeCount
		        	localStorage.setItem('refereeCount',res.data.data.refereeCount)
		        }
		        if (res.data.code === 110) {
		            router.push('/login')
		        }
			});
			//判断是否为会员
	        axios.post(api + '/user/getLevel?' + '&uid=' + localStorage.getItem('uid') + '&token=' + localStorage.getItem('token') + '&valid=0' + globalPM).then(function (res) {
				console.log(res.data)
		        if (res.data.code === 0) {
		        	if(res.data.data.level == 2){
		        		_this.huiyuan = true
		        		localStorage.setItem('huiyuan',_this.huiyuan)
		        	}else{
		        		_this.huiyuan = false
		        		localStorage.setItem('huiyuan',_this.huiyuan)
		        	}
		        }
			})
		},
		mounted() {
        	window.addEventListener('load', this.yaoqing, true)
 		},
	}
</script>

